INSERT INTO `tblquizquestions` VALUES (19,'An order picker goes to slot to select a carton of detergent and finds the slot is empty. What should he do?','Inventory mgrs will confirm the  item balance and fill-in orders where the item was not in the slot. Do not take cases from another slot because it will cause other inventory imbalances.','Call supervisor to locate more cartons','Locate a similar item and include it','Wait for the slot to be replenished','Mark item as Not Found and continue','Mark item as Not Found and continue',4,0,4,'Null','Null','Order Picking'),(18,'When a customer buys any piece of electronic equipment, you should always offer him a...?','Although we never expect our products to fail, the warranty will ensure that the customer has peace of mind for a very small investment.','Hand to load his car','Battery','Discount','Warranty','Warranty',3,1,3,'Null','Null','Warrantee Upsales'),(17,'You see a customer in the TV department. Which of the following questions should you NOT ask him?','It is important that you find out what the customer\'s requirements are before you make a recommendation. The customer may not know what technology best suits his/her needs','How is lighting in TV room?','Do you play video games on TV?','What type programs do you watch?','What type TV do you want to buy?','What type TV do you want to buy?',3,1,3,'Null','Null','TV Sales Process'),(16,'A customer tells you that she will put a TV in a room with many windows and no blinds. What type of TV should you recommend?','An LCD\'s bright picture will be look better in bright light; some LCD screens also resist glare.','Widescreen','HDTV','Plasma','LCD','LCD',3,1,3,'Null','Null','TV Sales Process'),(14,'A customer is interested in a cashmere sweater. She asks: Is this item going to go on sale? What do you say?','As part of our 30-day return policy, customers may request a credit if the price of an item they\'ve purchased is reduced.','Offer to call before the sale','Popular item will not last until sale','I don\'t have any info on sales','If item reduced in 30 days, get credit','If item reduced in 30 days, get credit',2,1,2,'310b8485-5d99-46e0-b061-facba7e78585.jpg','310b8485-5d99-46e0-b061-facba7e78585.jpg','Sale Policies'),(12,'This style of collar is called a(n)','The button down is a classic, versatile look that uses buttons to fasten the collar to the shirt.','Ainsley','Golf Collar','English Spread','Button-down','Button-down',2,1,2,'12c36265-088c-43f1-8f68-a64de1121dea.jpg','12c36265-088c-43f1-8f68-a64de1121dea.jpg','Product knowledge: Shirts'),(13,'How much will our 100% cotton shirts shrink after the first wash?','All our cotton shirts are pre-shrunk. Customers should notice no shrinking. This is one of the things that makes us unique and special.','2\" in length,  1/2\" in girth','1/2\" in length, 2\" in girth','About an inch in both directions','Not at all','Not at all',2,1,2,'9ef043d5-6f8c-4f5a-b106-c44845226b62.jpg','9ef043d5-6f8c-4f5a-b106-c44845226b62.jpg','Product knowledge: Shirts'),(11,'Which of these is least important when building a relationship with your client?','The two most important pieces of information you can get from a client are 1) her interests 2) her permission for you to contact her.','What she\'d like to be contacted about','The best times to contact her','How she\'d like to be contacted','Where she lives','Where she lives',2,1,2,'936c22cf-0ed9-42ef-b696-9af5c5774115.jpg','936c22cf-0ed9-42ef-b696-9af5c5774115.jpg','Client relationships 43'),(10,'A customer walks into the store and asks to return items she purchased through the company website. What should you do?','We encourage our customers to shop through all of our channels. To make their shopping experience convenient, they can also return items through any of those channels - no matter how they originally p','Refund the purchase price in cash','Check website for return policy','Process return if store carries item','Cedit original form of payment','Cedit original form of payment',2,1,2,'eefac3af-f87f-44e6-a333-f3921d121e92.jpg','eefac3af-f87f-44e6-a333-f3921d121e92.jpg','Return Policy 22'),(9,'A customer wants to return a $3,000 cocktail dress 3 days after buying it. You suspect she has worn it to an event. What should you do?','Our 30-day return policy applies to all unused / undamaged merchandise no matter how expensive it is. Be sure to inspect the garment for damage.','Call your manager','Credit applied in 1 day after inspected','Tell her she can\'t return it','Process the return just like any other','Process the return just like any other',2,1,2,'d74d5b04-2acc-44e9-99bf-deda94afe7e0.jpg','d74d5b04-2acc-44e9-99bf-deda94afe7e0.jpg','Return Policy 43'),(8,'What style of shoe is this?','You can tell it\'s a wingtip because of the wing shaped countours near the toe, as well as the perforations.','Cap-toe','Loafer','Saddle shoe','Wingtip','Wingtip',2,1,2,'75deaa5d-a4d0-4cdd-875c-c9ffaae8f9ba.jpg','75deaa5d-a4d0-4cdd-875c-c9ffaae8f9ba.jpg','Product knowledge: Shoes'),(7,'You see a customer take a small item off the shelf and put it in her purse. What do you do?','Never approach a shoplifter and confront them. We have procedures that must be followed and not doing so may open the company (and you) up to legal issues.','Nothing','Ask her to empty her purse','Confront her immediately','Report it to security','Report it to security',1,7,1,'1d5b1b75-b79b-431f-a2cf-56ce3fd7cacb.jpg','1d5b1b75-b79b-431f-a2cf-56ce3fd7cacb.jpg','Shoplifting Policy'),(6,'When bagging, you should always avoid doing the following:','Meat should always be bagged separately to avoid contamination by bacteria; heavy items can crush produce items and other fragile items; double bagging is sometimes very necessary; and chemicals shoul','Place meat in a separate bag','Place light items on top of tomatoes','Double bag heavy items','Put cleaning chemicals with food','Put cleaning chemicals with food',1,0,1,'35e1e054-f9c6-4f2c-98ab-c9d3f0fba3b2.jpg','35e1e054-f9c6-4f2c-98ab-c9d3f0fba3b2.jpg','Bagging Policy 37'),(5,'Which of the following Point of Sale actions require a manager\'s authorization?','When calling for a manager for authorization, always apologize to the customer for the delay.','Remove Item','Use of Department Key','Suspend/Resume Transaction','Price Override','Price Override',1,0,1,'e727c8bd-195c-49c8-87e8-6bdd56e40b58.jpg','e727c8bd-195c-49c8-87e8-6bdd56e40b58.jpg','POS Policy 44a'),(4,'You are in the middle of a task when a customer asks where to find an item. What do you do?','By walking with the customer to the product, you build a rapport with the customer. If you hand the product to the customer, there is a greater chance that she will buy it.','Point her in the general direction','Tell the customer the aisle #','Politely explain you are very busy','Walk to product and hand it to her','Walk to product and hand it to her',1,0,1,'2f3e22ac-6d67-444c-8085-ecb3c1322479.jpg','2f3e22ac-6d67-444c-8085-ecb3c1322479.jpg','Customer Service #244'),(3,'How often should utility clerks do store sweep to clean the floor and return misplaced items?','The sweep is one of the main duties for a utility clerk. By performing a sweep every hour, we ensure that the store always looks like an inviting place to shop.','Once per day','At the start of every shift','Every fifteen minutes','Every hour','Every hour',1,0,1,'a4cb8590-efe8-4d87-bbe3-62edd9f5f730.jpg','a4cb8590-efe8-4d87-bbe3-62edd9f5f730.jpg','Sweep Floor'),(1,'What type of Vegetable is this?','aka Curly Cabbage. With ruffled, lacy, deeply ridged leaves, perhaps the prettiest cabbages around. Delicious in salads or stir-fried.','Napa Cabbage','Chinese Cabbage','Bok choy','Savoy Cabbage','Savoy Cabbage',1,0,1,'c84121a1-4f6b-4181-b6ab-177df27105ad.jpg','c84121a1-4f6b-4181-b6ab-177df27105ad.jpg','Vegetables'),(2,'A customer asks for a recommendation for a wine to go with roast beef. What would you suggest?','Cabernet Sauvignon is a red wine with strong tannins, high acidity, and powerful flavors, usually black currant. Food pairings include beef and lamb dishes, venison, and a variety of cheeses.','Pinoit Grigio','Chardonnay','Sauvignon Blanc','Cabernet Sauvignon','Cabernet Sauvignon',1,0,1,'2647aefe-ffad-4ded-8bf4-a95284d6a79d.jpg','2647aefe-ffad-4ded-8bf4-a95284d6a79d.jpg','Red Wine'),(15,'A customer finds a pair of jeans she loves, but they\'re not available in her size. What do you do?','You should offer customers merchandise that we have anywhere in the chain, whether it\'s available in another store or on the web.','Tell her available size fits','Tell her to return for next delivery','Sell her on a different item','Check inventory at other stores.','Check inventory at other stores.',2,1,2,'26e436af-04ef-4160-bd44-5a75ba3b13bc.jpg','26e436af-04ef-4160-bd44-5a75ba3b13bc.jpg','Fitting assistance'),(22,'How often do you rotate your tires?','Rotating tires keeps them from wearing unevenly and that will make your ride smoother and handling safer.','5,000-7,000 kilometers','10,000 - 12,000 kilometers','12,000 - 15,000 kilometers','8,000-10,000 kilometers','8,000-10,000 kilometers',5,0,5,'159e6792-bca7-4fc1-bfef-1a32796c0048.jpg','159e6792-bca7-4fc1-bfef-1a32796c0048.jpg','Tire Rotation'),(20,'What does the acronym GLN stand for?','The Global Location Number is a unique number assigned by the standards body that identifies a distinct location in the word.','Global License Number','Great Location Name','Global Location name','Global Location Number','Global Location Number',4,0,4,'Null','Null','GLN'),(21,'What is a wave?','Picking by wave is the most effective way of picking in a multi store environment.','something on the sea','An informal greeting','A measure of light','A method of picking','A method of picking',4,0,4,'Null','Null','Wave'),(23,'What does TPMS stand for?','TPMS, Tire Pressure Monitoring System, is an electronic system that alerts you with a dashboard indicator light when your car\'s tire pressure falls to the point of needing inflation.','Titanium Pressed Mild Steel','Totally Perfect Muffler Sounds','Timed Pitch Monitoring System','Tire Pressure Monitoring System','Tire Pressure Monitoring System',5,0,5,'a71d659a-047d-41d2-a74b-93ea70620c36.jpg','a71d659a-047d-41d2-a74b-93ea70620c36.jpg','Tire Pressure'),(24,'215 / 65 R 15 - What does 65 represent?','The first two numbers tell you tire width in millimeters. The next numbers is the ratio of height to width. The last number is the rim size.','Wheel diameter (cm)','Maximum speed (mph)','Rubber thickness (mm)','Ratio of height to width','Ratio of height to width',5,0,5,'3a385d5b-862b-4b44-8658-c3c3c8375e16.png','3a385d5b-862b-4b44-8658-c3c3c8375e16.png','Tire Specs'),(25,'If you put studs on the front wheels, what do you put on the back?','Only if studded winter/snow tires are installed on all wheel positions of a vehicle will optimum handling characteristics be achieved','Chains','It doesn\'t matter','All weather tires','Studs','Studs',5,0,5,'89ef07c5-6c4a-4edd-a8e7-3a10e14174a1.jpg','89ef07c5-6c4a-4edd-a8e7-3a10e14174a1.jpg','Winter Driving'),(26,'What is the cause of this wear pattern?','If a vehicle\'s tires are overinflated by 6 psi, they could be damaged more easily when running over potholes or debris in the road.','Underinflation','Incorrect alignment','Worn struts','Overinflation','Overinflation',5,0,5,'85175ad5-aa8d-45d9-8296-f8bd89edcec4.jpg','85175ad5-aa8d-45d9-8296-f8bd89edcec4.jpg','Tire Wear'),(27,'How often should you change brake fluid?','Note that brake flushing and bleeding the brakes are two different procedures. Flushing involves removing all the brake fluid from the system and getting all-new, clean fluid inside.','20,000 kilometers','50,000 kilometers','75,000 kilometers','40,000 kilometers','40,000 kilometers',5,0,5,'2d41a98c-7c3d-4762-afe3-1c5bd6f9209a.jpg','2d41a98c-7c3d-4762-afe3-1c5bd6f9209a.jpg','Bake Fluid'),(28,'In very cold weather what oil should you use?','Multiple viscosity oils carry a range of numbers10W40, for example. In this case the 10 is a representation of the motor oil\'s viscosity when c','15w - 30','10w - 40','It doesn\'t matter','5w - 30','5w - 30',5,0,5,'ba0adaf5-1db7-4d1f-b6e9-ca2c950c805d.jpg','ba0adaf5-1db7-4d1f-b6e9-ca2c950c805d.jpg','Cold Weather'),(29,'How much does our Customer Care plan cost?','Unlike most competitors, our Customer Care Plan is FREE with the purchase of tires, wheels, batteries or services and is honoured at any Kal Tire location.','$10/tire','$50/year','$20/car','Free','Free',5,0,5,'50f0c6f4-61a3-4fa1-9bfe-cfc1ee2475a3.jpg','50f0c6f4-61a3-4fa1-9bfe-cfc1ee2475a3.jpg','Customer Care Plan'),(30,'If you buy tires at the Saskatoon store, where should you go for service?','Inflation should be checked once a month. This will be provided at no charge by any Kal Tire store.','The store you bought the tires','Stores in the same Province','Any store for additional fee','Any store','Any store',5,0,5,'f4c01edd-0bee-4e5e-a3b9-f9c0ce516d15.jpg','f4c01edd-0bee-4e5e-a3b9-f9c0ce516d15.jpg','Tire Service'),(31,'Which tire rating is the fastest?','The speed symbol denoting a fixed maximum speed capability of new tires must be shown only in the speed rating portion of the tire\'s service description, such as 225/50R16 89S','R Rated','S Rated','H Rated','Y Rated','Y Rated',5,0,5,'be680afa-dcd1-4809-b753-f08f48ae9ad4.jpg','be680afa-dcd1-4809-b753-f08f48ae9ad4.jpg','Tire Specs'),(47,'what is a size 8 in european?','A size 8 in American is a size 41.5 in European shoe size','90','42','59','41.5','41.5',2,1,8,'81c8ae86-3f45-4ef0-9ad7-e1f33558f712.jpg','81c8ae86-3f45-4ef0-9ad7-e1f33558f712.jpg',''),(46,'what type of shoe do wear in a formal setting?','Formal shoes should also be glossy in appearance. The most common are patent leather shoes, but if youre uncomfortable in patent leather, you can wear matte black leather shined to a ','sandals','sneakers','loafers','shiny patent leather shoes','shiny patent leather shoes',2,1,8,'080451ef-abdd-40e2-ba44-767b2b553c44.jpg','080451ef-abdd-40e2-ba44-767b2b553c44.jpg',''),(48,'what type of shoes are considered business casual?','For a professional appearance in casual wear, choose mens casual shoes like boat shoes or loafers. Your boat shoes should be made of leather and in good, clean co','flip flops','shiny patent leather','sneakers','loafers','loafers',2,1,8,'bfec4253-4ce3-4c4b-8f07-b50e1e667bfb.jpg','bfec4253-4ce3-4c4b-8f07-b50e1e667bfb.jpg',''),(38,'The links (button) on the item inquiry form provide access to reference information about an item including:  quantities, orders, sales, prices, promotions, etc.','The reference information provides everything that the business needs to know about an item','False','Mostly True','What links?','True','True',6,1,6,'d7e631ba-c2f2-41af-94b8-e841f66947ff.jpg','d7e631ba-c2f2-41af-94b8-e841f66947ff.jpg','Item Inquiry'),(39,'Which MM/SO functions require a Vendor record in MM/SO?','When an item is available from more than one vendor, that Item is said to be Multi-Sour','Generate a Purchase Order','Track Items Ordered','Track Vendor Deals','All of these','All of these',6,0,6,'933dfbb0-211f-4a0a-96ca-715162f1b535.jpg','933dfbb0-211f-4a0a-96ca-715162f1b535.jpg','Vendor Record'),(35,'What is an accounting cost method?','Most companies use standard cost. It is the least expensive to implement and maintain, and can give reasonably accurate costs. However, it is not the most accurate','A process for determining the price','The operations cost  on the GL','How to calculate cost of business','How a retailer values their invento','How a retailer values their invento',5,0,6,'97746ca1-0d1a-4eec-9566-dc7bc22bc89e.jpg','97746ca1-0d1a-4eec-9566-dc7bc22bc89e.jpg','Accounting Cost Method'),(36,'What Tomax form is used to look up information and real-time statistics on any item in inventory','Knowing how much inventory is available is vital information in insuring that the company does not incur excessive inventory costs','Vendor For