 do ?','In order to help them you must first know their size.','pick out a shirt','refer them to someone else','not help them','Ask them if they would like to meas','Ask them if they would like to meas',2,1,11,'18ce4052-6f51-4f48-8d7b-0eaf06c0e2bf.gif','18ce4052-6f51-4f48-8d7b-0eaf06c0e2bf.gif',''),(56,'Where do you measure the guest for a dress shirt?','Measurements need to be taken from the neck and the arms','the neck and torso','shoulders and torso','arms and waist','the neck and the arms','the neck and the arms',2,1,11,'3d76b926-138a-4b69-8928-11588d734631.jpg','3d76b926-138a-4b69-8928-11588d734631.jpg',''),(57,'What type of shirt would be best for a slim figured person ?','Slim-fit is the best fit for slim figured people.','Regular Fit','Classic Fit','Skinny Fit','Slim-Fit','Slim-Fit',2,1,11,'d3e60e3b-79a8-45d2-99b8-9a1a04bdbc75.jpg','d3e60e3b-79a8-45d2-99b8-9a1a04bdbc75.jpg',''),(58,'How wide should a tie bar for a skinny tie be?','Your tie bar should always be narrower than your tie.','1.3-1.4\"','2.0-2.5\"','6.0-6.5\"','1.5-1.75\"','1.5-1.75\"',2,1,12,'15591ff3-4fd6-4c1a-9213-47024dc224bd.jpg','15591ff3-4fd6-4c1a-9213-47024dc224bd.jpg','Tie bars'),(59,'which material would be best for a premium finished look?','Silk is luxury: light weight and smooth.','mircofiber','wool','cotton','Silk','Silk',2,1,12,'65f79689-5594-48b8-8b61-fddf475a9d6e.jpg','65f79689-5594-48b8-8b61-fddf475a9d6e.jpg','Materials'),(60,'How long should a tie be?','According to skinnyties.com, 5658 inch ties will fit 90% ','60-69 inches','34-35 inches','40-45 inches','56-58 inches','56-58 inches',2,1,12,'5b68f6a7-274e-4c79-a4e7-190e37f4fa2f.jpg','5b68f6a7-274e-4c79-a4e7-190e37f4fa2f.jpg','Tie length'),(61,'What type of shirt are cuff links worn with?','ufflinks are worn only on French-cuff shirts.','Regular Dress Shirts','Tuxedo Shirts','Tshirts','French Cuff Shirts','French Cuff Shirts',2,1,12,'9c883c04-56b3-4b58-ba39-9e47cdf1705e.jpg','9c883c04-56b3-4b58-ba39-9e47cdf1705e.jpg','Cufflinks'),(62,'What is the best breathable material to purchase when purchasing a suit?','Wool is a natural fiber that breathes, which means you\'ll be more comfortable and you\'ll sweat less than in a suit made of man-made materials.','cotton','polyester','microfiber','wool','wool',2,1,13,'00337def-1b60-477b-86e2-344dd959652a.jpg','00337def-1b60-477b-86e2-344dd959652a.jpg',''),(63,'What type of cut would be best for a sleek, modern look?','The European cut (Italian). Sleek, modern, with padded shoulders, no vents, flapless pockets, and tapered waist (V-shape) on the jacket.','American Cut','British Cut','Madagascar Cut','European Cut','European Cut',2,1,13,'7a20f81f-c2ab-4648-b611-153ea919b22e.jpg','7a20f81f-c2ab-4648-b611-153ea919b22e.jpg',''),(64,'Which of the following does NOT need to be measured when fitting for a a suit?','You should take all measurements: neck, shoulders, sleeves, chest, waist, and inseam. Measure them first, before you begin looking at suits.','inseam','neck','shoulders','Leg Length','Leg Length',2,1,13,'d250ad4b-50bd-4291-93de-f271b113441d.jpg','d250ad4b-50bd-4291-93de-f271b113441d.jpg',''),(65,'check','check','b','c','d','a','a',1,1,16,'47551bc6-794f-4490-b15d-50af7f62b24b.jpg','47551bc6-794f-4490-b15d-50af7f62b24b.jpg','check'),(66,'how r you','whats','b','c','d','a','a',1,1,16,'d2f11bd7-6fb9-4a92-9fea-cff1d8366dd0.jpg','d2f11bd7-6fb9-4a92-9fea-cff1d8366dd0.jpg','hru'),(68,'As a Merchandiser, what is the 1st thing  you do when arriving at the store','It is important to establish a positive relationship with the store manager.','Inventory cards','Check deliveries','Have coffee','Check in with store manager','Check in with store manager',2,0,26,'a505077c-05ec-47f0-9048-ad0849c58c82.jpg','a505077c-05ec-47f0-9048-ad0849c58c82.jpg','Arrival process'),(69,'What do you do if slot is empty and no shipment is on the way?','Accurate inventory is key to insuring that cards are available when the customer wants to buy them','Fill the slot with other cards','Do nothing','Create manual order','Audit the inventory location','Audit the inventory location',2,0,26,'e4cd1df6-4b26-4836-954c-09fdfef8a3c9.jpg','e4cd1df6-4b26-4836-954c-09fdfef8a3c9.jpg','Audit'),(70,'What do you do with holiday cards after the holiday is over?','Our cards represent our brand. We are very careful about managing our distribution channels at all times.','Take them home','Donate them to charity','Sell them at Flea Market','Return to Hallmark','Return to Hallmark',2,0,26,'1b01ba5a-2cee-41d4-8630-a4bf884c8a55.jpg','1b01ba5a-2cee-41d4-8630-a4bf884c8a55.jpg','Card disposal'),(71,'What is the correct way to greet a guest?','Always greet the guest with the time of day (morning, afternoon, evening) and make them feel welcome at your store.','Hi.','Hey, wassup?','Say nothing at all','Good Afternoon. Welcome to ______.','Good Afternoon. Welcome to ______.',2,0,27,'91d497a7-a1c5-4673-ab06-ba76f486f7c7.jpg','91d497a7-a1c5-4673-ab06-ba76f486f7c7.jpg','Greet a guest'),(72,'What is the best way to ask if a customer needs help?','By asking politely, you can gain trust and confidence with the guest. When the guest is comfortable with you they will be more likely to buy from you.','You need help?','If you need help ask.','What do you need?','How can I help you?','How can I help you?',2,0,27,'76322476-a1fc-437a-ae44-cfc818bcd52c.png','76322476-a1fc-437a-ae44-cfc818bcd52c.png','Customer needs help ?'),(73,'What do you do if a guest needs your help but you\'re working on a task ?','Taking care of our guests is our main priority. If a guest asks you for help while you\'re doing a task, set it aside and help the guest.','Tell the customer you\'re busy','Continue to work on your task','Tell them to ask someone else','Set aside your task for a moment','Set aside your task for a moment',2,0,27,'aec1f3d0-e561-4dea-a758-3abd579d1250.png','aec1f3d0-e561-4dea-a758-3abd579d1250.png','Too busy to help'),(74,'Where are the women\'s shoes located?','Women\'s shoes are located on the 2nd Floor between the kids department and the registers','Lower Level','1st floor','3rd floor','2nd floor','2nd floor',2,0,27,'8bf3e2ba-cfd6-4cbb-809f-d6b137d446a6.png','8bf3e2ba-cfd6-4cbb-809f-d6b137d446a6.png','Women\'s shoes location'),(75,'What time should you arrive for your shift?','You should always arrive at least 10 minutes before your shift. It leaves time to pick up your check, to change etc.','The exact time of your shift','5 minutes before','5 minutes after','10 minutes before','10 minutes before',2,0,27,'a930dd47-1992-4e90-9375-fd0719fb1ffe.png','a930dd47-1992-4e90-9375-fd0719fb1ffe.png','Shift times'),(76,'Where is the mens dressing room?','On the 3rd floor, directly in front of mens jackets/coats','2nd floor','Lower Level','1st floor','3rd floor','3rd floor',2,0,27,'3d192798-4277-4a82-bad5-4741e2ec7994.png','3d192798-4277-4a82-bad5-4741e2ec7994.png','Dressing room location'),(77,'If you have nothing to do during your shift, what should you do?','Nothing to do at the moment? It happens. Simply alert the manager or continue with customer service activities to build sales or loyalty count.','Get guest to sign up for loyalties','Greet and help customers','Let a manager know','All these options','All these options',2,0,27,'57e574d7-6e59-43f6-964a-6b62b11dba39.png','57e574d7-6e59-43f6-964a-6b62b11dba39.png','Idle time'),(78,'What day free Big Gulp Drinks are offered?','This is to make employee understand the combination.','Every Monday 5 p.m to 7 p.m','Every  Sunday 5 p.m to 7 p.m','Every Tuesday 5 p.m to 7 p.m','Every Saturday 5 p.m to 7 p.m','Every Saturday 5 p.m to 7 p.m',7,9,28,'b6171b5f-6227-4ed7-929f-09d43539f2e9.png','b6171b5f-6227-4ed7-929f-09d43539f2e9.png','and with What combination?'),(79,'What is the best thing to do when customer tries to give $100 dollar bill?','To minimize robbery our aim is to keep minimum money in register.','Refuse to sell products','Say that register do not have chang','Immediately take it and give change','Politely ask for smaller bills.','Politely ask for smaller bills.',8,9,28,'d51c79e2-9f0e-4e23-9513-397398fe1acd.png','d51c79e2-9f0e-4e23-9513-397398fe1acd.png','Change policy'),(80,'What is the first thing while offering hot food to customer?','To make employee know how to serve hot food.','Bare hand because its busy.','Ask them to wait','No hot Food','Always wear Gloves.','Always wear Gloves.',9,9,28,'b715f41c-662f-438a-93b7-b49e8849a156.png','b715f41c-662f-438a-93b7-b49e8849a156.png','Hot Food'),(81,'A fellow employee constantly disrespects and curses at you, what do you do?','Best thing to do is report it. You never know who else they can be their victim. An employee should know not to curse or disrespect others in the work environment.','Curse him/her out','Give them a hug and figure out why','Try to get them fired','Report it to a manager or superviso','Report it to a manager or superviso',3,10,30,'ebf9f20b-4444-4482-81ac-637fae021c40.jpg','ebf9f20b-4444-4482-81ac-637fae021c40.jpg','Insult'),(82,'What is the first thing to do when customers enter to store?','Customer service is the most important part of the business.','Ask to buy new item.','Tell them about special offers.','Do not look at them.','Greet them','Greet them',10,9,28,'cb375927-f823-4dbf-bd2c-d06cd6226872.png','cb375927-f823-4dbf-bd2c-d06cd6226872.png','Customer service'),(83,'A customer puts a product they didn\'t pay for in his bag, what do you do?','Never attempt to resolve theft yourself. Always let Asset Protection know.','Tackle the customer','Yell at him to STOP','Reach in his bag an take it back','Notify Asset Protection','Notify Asset Protection',3,10,30,'bc4e79f2-48d3-42ec-be47-7f06c9d3fb00.jpg','bc4e79f2-48d3-42ec-be47-7f06c9d3fb00.jpg','Theft'),(84,'Joey constantly flirts with Rachel by asking her out on dates and carresing her shoulder. She feels uncomfortable. What should she do?','After telling him, if he continues best to report him to HR or a manager','Tell him she\'s out of his league','Slap him','Start carrying mace','Tell him it makes her uncomfortable','Tell him it makes her uncomfortable',3,10,30,'f5c0f89c-c34e-48fc-b327-f7fe22238673.jpg','f5c0f89c-c34e-48fc-b327-f7fe22238673.jpg','Flirt'),(85,'A customer leaves their wallet after paying. They walk a few steps ahead and answer a phone call. What should you do?','Give the wallet back if they are in store still, if they have walked out give it Asset Protection to put in Lost and Found','They wont need it anymore!','Return after taking the cash','Turn it in to a manager','Walk up to them and return it','Walk up to them and return it',3,10,30,'32455885-5c07-47df-be21-0e442a36b5c5.jpg','32455885-5c07-47df-be21-0e442a36b5c5.jpg','wallet'),(86,'You received cash but gave the wrong amount of change back. You realize this as the customer is walking away. What should you do?','Everyone makes mistakes. Give them the correct change back.','Give change from your wallet','Give the next customer more change','They won\'t notice','Notify them and give correct change','Notify them and give correct change',3,10,30,'add0685c-accc-4f4a-aaa0-4093e6f66c6d.png','add0685c-accc-4f4a-aaa0-4093e6f66c6d.png','Miscount'),(87,'When buying a Blu Ray player, what else would a customer need?','Blu Ray players require an HDMI cable from TV to the player','Aux cord','VGA cable','Ethernet cable','HDMI cable','HDMI cable',3,10,29,'b1b7b853-a412-49d3-85ba-89f542407d75.jpg','b1b7b853-a412-49d3-85ba-89f542407d75.jpg','Blu Ray'),(88,'What is the difference between LED and LCD?','LEDs produce their own light for a clearer picture.','LCD looks sharper than LED','LCD costs more than LED','LED can be wall mounted LCD can\'t','LED looks sharper than LCD','LED looks sharper than LCD',3,10,29,'e714b7eb-aa1a-4ec7-918a-fa384d7ded7a.jpg','e714b7eb-aa1a-4ec7-918a-fa384d7ded7a.jpg','LED LCD'),(89,'A customer wishes to stream media from his laptop, smartphone, and tablet to his TV wirelessly. Which is the best device?','Chromecast allows wireless streaming from all devices.','Apple TV','ROKU box','MHL adapter','Chromecast','Chromecast',3,10,29,'2aed460b-c5a7-46a5-847a-95c12bca3778.jpg','2aed460b-c5a7-46a5-847a-95c12bca3778.jpg','stream'),(90,'What section do you find Hot Food in POS menu?','To provide training about POS','AM','Other Department','All of the above','PM','PM',11,9,28,'f6a0e568-4e4a-409f-a530-97f76239233e.png','f6a0e568-4e4a-409f-a530-97f76239233e.png','Menu'),(91,'What section do you find bakery and drinks in POS?','For POS trainning','PM','Other department','Lotto sale','AM','AM',11,9,28,'40553dcf-4456-453f-bee8-884b075e7de2.png','40553dcf-4456-453f-bee8-884b075e7de2.png','Bakery and Drinks'),(92,'What button do you press for lottery scratch winners?','Training on POS','Lotto win','Lotto sale','Other Department','Scratch win','Scratch win',11,9,28,'232aebd2-7ff9-417c-8088-da25f8a38a5d.png','232aebd2-7ff9-417c-8088-da25f8a38a5d.png','Lottery'),(93,'What do you do when your POS stop working?','POS Training','Try to fix by yourself','Unplug and plugin again','all of the above','Call Customer Service Immediately','Call Customer Service Immediately',11,9,28,'dc69a6de-3e2a-4369-a45b-bbf5f58ab45a.png','dc69a6de-3e2a-4369-a45b-bbf5f58ab45a.png','POS'),(94,'What do you do when customer come back to return Money order?','General Training','Return Immediately','Refuse to Return','All of the above','Call your Supervisior','Call your Supervisior',8,9,28,'003dc5ab-386a-40fc-bb8a-ca48102ff1da.png','003dc5ab-386a-40fc-bb8a-ca48102ff1da.png','Money Order'),(95,'What do you do when someone tries to rob the register?','Preventive measures','Fight Back','Call police Immediately','Start shouting','Do not resist, just do as they say','Do not resist, just do as they say',12,9,28,'801a6022-6b61-4e22-af9f-d014253ad7c4.png','801a6022-6b61-4e22-af9f-d014253ad7c4.png','Asset Protection'),(96,'What is the difference between the ROKU box 1, 2, and 3?','Roku 3 lets you use your headphones when streaming to the TV. You also have a USB port to playback music, photos, videos from an attached drive.','Roku 2 is faster than Roku 3','Roku 1 doesn\'t have remote','Roku 3 does\'t require HDMI','Roku 3 has audio jack,USB port,SD','Roku 3 has audio jack,USB port,SD',3,10,29,'1e74ac89-ce39-42d8-b061-662b9c0721c1.png','1e74ac89-ce39-42d8-b061-662b9c0721c1.png','ROKU'),(97,'What are the best products available in stores?','QA','Everything in stock','From fruitolays','Any Expensive Brands','All 7 select product','All 7 select product',1,9,28,'58888efe-2201-4796-ba13-8c3d7656be16.png','58888efe-2201-4796-ba13-8c3d7656be16.png','QA'),(98,'Which is NOT a type of TV wall mount?','There is no swing mount','Fixed','Full motion','Tilt','Swing','Swing',3,10,29,'55512d95-996e-45aa-8e79-a057fad999af.jpg','55512d95-996e-45aa-8e79-a057fad999af.jpg','mount'),(101,'What determines the speed of an HDMI cable?','GBPS(Gigabits per second) determines speed of HDMI, also the higher the better the quality','Length','Brand','Durability','GBPS','GBPS',3,10,29,'cab4fe86-601e-423d-a473-ace7888f28cc.jpg','cab4fe86-601e-423d-a473-ace7888f28cc.jpg','HDMI');
