SET p_Select = 
'SELECT a.ContestId, a.ContestName, a.FromDate, a.ToDate, a.KPI_ID, b.Role_Id, c.Site_Id
FROM tblcontests a
INNER JOIN tblcontestsroles b ON a.ContestId = b.ContestId
INNER JOIN tblcontestssites c ON a.ContestId = c.ContestId';

