CREATE PROCEDURE `sp_GetRewardUser`(p_UserID INT)
BEGIN
SELECT tblRedeem.Reward_ID,
 			tblRedeem.Redeem_Date,tblRedeem.User_ID,

				tblRewards.Reward_Name,

				tblRewards.Reward_ID,

