CREATE PROCEDURE `sp_MatchLevels`(p_MatchID INT)
BEGIN
	SELECT
	tblRoles.Role_ID,
	tblRoles.Role_Name,
	tblLevel.Level_ID,
	tblLevel.Level_Name,
	tblLevel.Level_Position,
	(Select 'yes' from tblmatchlevels where tblmatchlevels.LevelID=tblLevel.Level_ID and MatchID =p_MatchID) as Allow
