CREATE PROCEDURE `sp_UpdateLevelPosition`(p_xml VARCHAR(1000))
BEGIN



DECLARE i INT DEFAULT 1;

DECLARE xml VARCHAR(1000);

SET xml = p_xml;



WHILE i < LENGTH(xml)

DO

UPDATE tblLevel

SET Level_Position = (ExtractValue(xml, '//levelposition[$i]'))

WHERE Level_ID  = (ExtractValue(xml, '//levelid[$i]'));



SET i = i + 1 ;

 END WHILE;



END ;;
